import React from "react";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import Typography from "@mui/material/Typography";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import { format } from "date-fns";

function createData(inputDate: any, info: any) {
  const formatday = format(inputDate, "yyyy年MM月dd日 HH:mm:ss");
  return { formatday, info };
}

const rows = [
  createData(20230312, 159),
  createData(20230312, 237),
  createData(20230312, 262),
  createData(20230312, 305),
  createData(20230312, 356),
];
function WhatNew() {
  return (
    <div className="WhatNew">
      <Typography variant="h5" style={{ color: "red" }}></Typography>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>＜新着情報＞</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow key={row.formatday}>
                <TableCell>{row.formatday}</TableCell>
                <TableCell>{row.info}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}

export default WhatNew;
